To calculate \(99^2 + 99 + 1\) in my head, I can use algebraic manipulation to simplify the expression. Notice that the expression \(99^2 + 99 + 1\) can be rewritten in a form that allows us to use the difference of squares.

First, let's rewrite the expression:
\[99^2 + 99 + 1 = 99^2 + 99 + \frac{1}{4} - \frac{1}{4} + 1 = 99^2 + 99 + \frac{4}{4} - \frac{1}{4} = 99^2 + 99 + \left(1 - \frac{1}{4}\right) = 99^2 + 99 + \left(\frac{3}{4}\right)\]
However, a simpler approach is to recognize that:
\[99^3 + 1 = (99+1)(99^2 - 99 + 1) = 100(99^2 - 99 + 1) = 99^2 - 99 + 1 + 99^3 - 99^2 + 1 = 100^2 = 10000\]
Thus, we can directly see that:
\[99^2 + 99 + 1 = \frac{100^3 - 1}{99}\]

