original_question:
Un campo rectangular está encerrado en una pista atlética, como se muestra a continuación. La pista consta de dos bordes del campo y dos semicírculos. La longitud de la pista es de 400 metros. ¿Cuál es el área más grande posible del campo, en metros cuadrados?

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));
[/asy]

